from AES import AES_256


def test_key_expansion():
    instance = AES_256()
    ret_w = instance.KeyExpansion(b'\x60\x3d\xeb\x10\x15\xca\x71\xbe\x2b\x73\xae\xf0\x85\x7d\x77\x81\x1f\x35\x2c\x07\x3b\x61\x08\xd7\x2d\x98\x10\xa3\x09\x14\xdf\xf4',b'\x00'*240, 8, 4, 14, verbose=True)
    actual_w = bytearray.fromhex('')
    #Test if key expansion works as per https://nvlpubs.nist.gov/nistpubs/fips/nist.fips.197.pdf A.3 - Expansion of a 256-bit Cipher Key page 30
    assert(ret_w == actual_w)
    return True


assert(test_key_expansion())